function loadFonts(){if(sessionStorage.fontsLoaded){document.documentElement.classList.add("fonts-loaded");return}"fonts"in document&&Promise.all([document.fonts.load("1em Roboto"),document.fonts.load("500 1em Roboto"),document.fonts.load("700 1em Roboto"),document.fonts.load("900 1em Roboto"),document.fonts.load("italic 1em Roboto"),document.fonts.load("italic 500 1em Roboto"),document.fonts.load("italic 700 1em Roboto"),document.fonts.load("italic 900 1em Roboto")]).then(o=>{document.documentElement.classList.add("fonts-loaded"),sessionStorage.fontsLoaded=!0})}loadFonts();
